import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import '../App.css';

const HomeScreen = (props) => {
    return(
        <Container>
           <Row style={{backgroundColor:"#379683", borderRadius:"5px"}}>
               <Col>
                    <h1>Hey, congrats on logging in</h1>
               </Col>
           </Row>
        </Container>
    )
}

export default HomeScreen;
